import React, {useState, useEffect} from "react";
import DragNDropFileUpload from "./DragNDropFileUpload";
import DragNDropImageUpload from "./DragNDropImageUpload";

const DragNDropCaller : React.FC = () => {

  const [files, setFiles] = useState("");
  
  const addFile = (file: any) => {
      console.log(file);
      setFiles(URL.createObjectURL(file));
    };
    
      useEffect(() => {
          // Make sure to revoke the data uris to avoid memory leaks
          URL.revokeObjectURL(files);
      }, [])
    
    return (
      <div>
        <DragNDropFileUpload addFile={addFile} files={files} />
        <DragNDropImageUpload addFile={addFile} files={files} />
      </div>
    );
}

export default DragNDropCaller;
